import React, { Component } from "react";
import { Card, Button, CardDeck } from "react-bootstrap";
import CloudUploadIcon from "@material-ui/icons/CloudUpload";
import PropTypes from 'prop-types';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import InputBase from '@material-ui/core/InputBase';
import { fade } from '@material-ui/core/styles/colorManipulator';
import { withStyles } from '@material-ui/core/styles';
import MenuIcon from '@material-ui/icons/Menu';
import SearchIcon from '@material-ui/icons/Search';

import "./App.css";
import axios from "axios";
const styles = theme => ({
  root: {
    width: '100%',
  },
  grow: {
    flexGrow: 1,
  },
  menuButton: {
    marginLeft: -12,
    marginRight: 20,
  },
  title: {
    display: 'none',
    [theme.breakpoints.up('sm')]: {
      display: 'block',
    },
  },
  search: {
    position: 'relative',
    borderRadius: theme.shape.borderRadius,
    backgroundColor: fade(theme.palette.common.white, 0.15),
    '&:hover': {
      backgroundColor: fade(theme.palette.common.white, 0.25),
    },
    marginLeft: 0,
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      marginLeft: theme.spacing.unit,
      width: 'auto',
    },
  },
  searchIcon: {
    width: theme.spacing.unit * 9,
    height: '100%',
    position: 'absolute',
    pointerEvents: 'none',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputRoot: {
    color: 'inherit',
    width: '100%',
  },
  inputInput: {
    paddingTop: theme.spacing.unit,
    paddingRight: theme.spacing.unit,
    paddingBottom: theme.spacing.unit,
    paddingLeft: theme.spacing.unit * 10,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      width: 120,
      '&:focus': {
        width: 200,
      },
    },
  },
});


class App extends Component {
  handleselectedFile = event => {
    this.setState({
      selectedFile: event.target.files[0],
      loaded: 100
    });
  };
  handleUpload = () => {
    console.log("uploaded");
    const data = new FormData();
    data.append("file", this.state.selectedFile, this.state.selectedFile.name);

    axios
      .post("http://192.168.1.20:5000/upload", data, {
        onUploadProgress: ProgressEvent => {
          this.setState({
            loaded: (ProgressEvent.loaded / ProgressEvent.total) * 100
          });
        }
      })
      .then(res => {
        console.log(res.statusText);
      });
  };
  render() {
    const { classes } = props;

    return (

      <div className="App">
      <div className={classes.root}>
      <AppBar position="static">
        <Toolbar>
          <IconButton className={classes.menuButton} color="inherit" aria-label="Open drawer">
            <MenuIcon />
          </IconButton>
          <Typography className={classes.title} variant="h6" color="inherit" noWrap>
            Material-UI
          </Typography>
          <div className={classes.grow} />
          <div className={classes.search}>
            <div className={classes.searchIcon}>
              <SearchIcon />
            </div>
            <InputBase
              placeholder="Search…"
              classes={{
                root: classes.inputRoot,
                input: classes.inputInput,
              }}
            />
          </div>
        </Toolbar>
      </AppBar>
    </div>
        <CardDeck>
          <div className="flex flex-wrap -m-3 w-full sm:w-1/2 md:w-1/3 flex flex-col p-3 bg-white rounded-lg shadow-lg overflow-hidden flex-1 flex flex-col">
            <Card bg='danger'>
              <Card.Img
                variant="top"
                src="/home/nineleaps/Desktop/upload-1118929_960_720.png"
              />
              <Card.Body>
                <Card.Title>Adhaar Card</Card.Title>
                <Card.Text />
              </Card.Body>
              <Card.Footer>
                <small className="text-dark">
                  <input
                    type="file"
                    name=""
                    id=""
                    onChange={this.handleselectedFile}
                  />

                  <Button
                    variant="contained"
                    color="default"
                    onClick={this.handleUpload}
                  >
                    Upload
                    <CloudUploadIcon />
                  </Button>
                </small>
              </Card.Footer>
            </Card>
          </div>
          <div className="flex flex-wrap -m-3 w-full sm:w-1/2 md:w-1/3 flex flex-col p-3 bg-white rounded-lg shadow-lg overflow-hidden flex-1 flex flex-col">
          <Card
            bg="danger"

          >
            <Card.Img variant="top" src="holder.js/100px160" />
            <Card.Body>
              <Card.Title>Pan Card</Card.Title>
              <Card.Text />
            </Card.Body>
            <Card.Footer>
              <small className="dark">
                <input
                  type="file"
                  name=""
                  id=""
                  onChange={this.handleselectedFile}
                />
                <Button
                  variant="contained"
                  color="default"
                  onClick={this.handleUpload}
                >
                  Upload
                  <CloudUploadIcon />
